Route.create!(user: user, name: "Hadrian's Wall Path", description: "This trail is truly unique, offering city, country and ancient history along its route. Hadrian’s Wall is the largest Roman artefact remaining anywhere today. Built in 122AD, this extraordinary structure is still in remarkable condition in places. This trail allows you to explore the length of the wall from coast to coast, linking the vibrant cities of Carlisle and Newcastle. Along the route you’ll pass through beautiful rolling hills and rugged moorland. Whilst walking the trail, you’ll encounter many Roman settlements and forts dotted along its length. If you’re interested in exploring these sites and museums further, make sure you allow yourself more time.", coordinates: "[[-3.21164681861093,54.9541356053614],[-3.21156288560615,54.9539654016331],[-3.21133341796361,54.9539851857142],[-3.20970611458755,54.9538755741227],[-3.20657776490491,54.953699967197],[-3.20495559825784,54.9537136753789],[-3.20465113161578,54.9536933810866],[-3.20385122943555,54.9536049395911],[-3.20294281927613,54.9534804063014],[-3.20188028602658,54.9532646375759],[-3.20129630132936,54.9530602902258],[-3.20079006279214,54.9528406242085],[-3.20061459619501,54.9527165430195],[-3.20006991472145,54.9522546106727],[-3.19946039642406,54.9517124349446],[-3.19898192689214,54.9513756592909],[-3.198475187193,54.95113801529],[-3.19752763808728,54.9507788995144],[-3.19732310828738,54.95072699442],[-3.19705640722061,54.9506846882828],[-3.19392433620998,54.9503740069549],[-3.19348540263903,54.9503154117424],[-3.19164684722828,54.9499200652522],[-3.19127009371635,54.9498518653511],[-3.19031473080268,54.9497533868975],[-3.18897072991154,54.9497126253405],[-3.18870324835343,54.9496433482112],[-3.18857969940496,54.9496894907915],[-3.18843921491225,54.9496908649719],[-3.18728067589296,54.9495853631207],[-3.18641580797434,54.9493781284917],[-3.18625014259447,54.9492444590424],[-3.18618806003739,54.9491113418648],[-3.18612430458122,54.9490380300